  false,\n\t\"url\": null,\n\t\"notes\": \"The Fire Perimeters data consists of CDF
  fires 300 acres and greater in size and USFS fires 10 acres and greater throughout
  California from 1950 to 2003. Some fires before 1950, and some CDF fires smaller
  than 300 acres are also included. BLM fires are complete since 2002 for fires greater
  than 10 acres in size. Integration of historical BLM fires is incomplete and work
  is ongoing . NPS fires greater than 10 acres in size are complete for only two parks
  -- Sequoia-Kings Canyon and Yosemite. Efforts to integrate remaining NPS fire history
  is ongoing. In 2002 criteria expanded for new CDF fires to include timber fires
  greater than 10 acres, brush fires greater than 50 acres, grass fires greater than
  300 acres, wildland fires destroying three or more structures, and wildland fires
  causing $300,000 or more in damage. For details see FRAP website Fire Perimeters
  at http://frap.cdf.ca.gov/projects/fire_data/fire_perimeters/\",\n\t\"license_title\":
